import React from 'react';


function Navbar(){
  return(
    <>
        <div class="navbar">
        <img src="" alt="logo" srcset="" />
        <div class="navbar-inside-div">
        <a href="/">Home</a>
        <a href="#Hollywood" >Hollywood</a>
        <a href="#Hindi">Hindi</a>
        <a href="#Top 10">Top 10</a>
        </div>
        <input type="text" name="UserSearch" id="" />
        </div>
    </>
  );
}

export default Navbar;
